import "./Collapse_logement.css";

function Collapse_logement(props) {
  const {
    titre_collapse_logement,
    type_collapse_logement,
    description_collapse_logement,
  } = props;

  if (type_collapse_logement === "Description") {
    return (
      <>
        <div className="kasa-collapse-logement">
          <details className="kasa-collapse-logement-details">
            <summary>
              <h3 className="kasa-collapse-logement-title">
                {titre_collapse_logement}
              </h3>
            </summary>
            <div className="kasa-collapse-logement-texte">
              {description_collapse_logement}
            </div>
          </details>
        </div>
      </>
    );
  }
  <div className="kasa-collapse">
    <details className="kasa-collapse-details">
      <summary>
        <h3 className="kasa-collapse-title">{titre_collapse}</h3>
      </summary>
      <div className="kasa-collapse-texte">{description_collapse}</div>
    </details>
  </div>;

  if (type_collapse_logement === "Equipements") {
    return (
      <>
        <div className="kasa-collapse-logement">
          <h3 className="kasa-collapse-logement-title">
            {titre_collapse_logement}
          </h3>
          <div className="kasa-collapse-logement-chevron">
            <i className="fa-solid fa-chevron-up"></i>
          </div>
        </div>
        <div className="kasa-collapse-logement-texte">
          <p>{description_collapse_logement}</p>
        </div>
      </>
    );
  }

  return true;
}

export default Collapse_logement;
